import react from 'react';

const Navigation = ({ onRouteChange, isSignedIn }) => {
		if (isSignedIn) {
			return (
				<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
					<p onClick={() => onRouteChange('home')} className='f3 link dim white underline pa3 pointer'>NEMO</p>
					<p onClick={() => onRouteChange('signout')} className='f3 link dim white underline pa3 pointer'>Sign Out</p>
					<p onClick={() => onRouteChange('account')} className='f3 link dim white underline pa3 pointer'>My Account</p>
				</nav>
			);
		} else {
			return (
				<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
					<p onClick={() => onRouteChange('signin')} className='f3 link dim white underline pa3 pointer'>NEMO</p>
					<p onClick={() => onRouteChange('signin')} className='f3 link dim white underline pa3 pointer'>Sign in</p>
					<p onClick={() => onRouteChange('register')} className='f3 link dim white underline pa3 pointer'>Register</p>
				</nav>
			);

		}
}

export default Navigation

